import React from "react";
import {useState} from 'react';
import StarRating from './starrating'

export default class ReviewForm extends React.Component {

    constructor(props){
        super(props);

        this.state = {
            review: {
                name: props.name,
                review: props.review,
                rating: props.rating
            }
        }
    }

    render(){
        return(
        <div>
            <label>
                Name:
            </label>
            <input type='text' value={this.state.review.name}/>
            <br/>
            <label>
                Review:
            </label>
            <input type='text' value={this.state.review.review}/>
            <br/>
            <label>
                Rating:
            </label>
            <input type='text' value={this.state.review.rating}/>
            <br/>
        </div>
   ); };
}
